import moment from 'moment'

const weekdayshort = moment.weekdaysShort()
let weekdayshortname = weekdayshort.map(day => {
    return (
      <th key={day} className="week-day">
       {day}
      </th>
    )
})

const calendar = () => {
    return (
        <div>
            <h2>Calendar</h2>
            {weekdayshortname}
        </div>
    )
}

export default calendar
